        <p> Everyone has them. </p>
        <p>They are easy to make, but hard to keep.</p>
        <p>We help you achieve your goals by providing a platform that fosters </p>
        <p><span className="p-emphasize" style={{fontSize: '40px'}}>Accountability & Consistency.</span></p>
    </div>
  </div>

